import{B as a,_ as t,o,c as s,e as n,b as e}from"./index.js";const r={setup(){a({title:"Planar Cosmology"})}};const h=e('<p data-v-33854e1f> The Planes in Elthelas are geographically coexistent, but the actual matter making them up is separated by barriers of arcane force. Thus, planes being adjacent is simply describing that there is only one barrier between them. Since cutting through multiple planar barriers at once requires exponentially more energy, planar travel typically requires movement through adjacent planes. </p><div data-v-33854e1f><img src="https://elthelas-images.herokuapp.com/maps/elthelas-planar-map.jpg" style="width:100%;" alt="A map of the Planes of Elthelas" data-v-33854e1f><p data-v-33854e1f> Map image courtesy of <a href="https://github.com/sethscheib" data-v-33854e1f>Seth Scheib</a>, Art by Chyna Schut </p></div><h3 data-v-33854e1f>The Planes of Creation</h3><p data-v-33854e1f> These are the planes derived from the essence of Gaian, the heart of creation. The geography of each of these planes is mirrored between them, the root of which is the Material, and all the others being reflections of that. </p><h4 data-v-33854e1f>Elthelas, the Material Plane</h4><p data-v-33854e1f><strong data-v-33854e1f>Home of: </strong> Gaian</p><p data-v-33854e1f> The central plane of creation, home of Gaian and the place where physics behaves most like you or I would expect. </p><h4 data-v-33854e1f>Etherium, or the Ethereal Plane</h4><p data-v-33854e1f><strong data-v-33854e1f>Home of: </strong> Mystikinae</p><p data-v-33854e1f> The Etherium is a hazy reflection of the material plane, where distances and time are not absolute, and it is almost impossible to navigate. It is possible to see easily from Etherium to Elthelas, but nearly impossible to see Etherium from Elthelas. Etherium is the easiest plane to pass into or out of from the Material. </p><h4 data-v-33854e1f>The Shadowfell</h4><p data-v-33854e1f><strong data-v-33854e1f>Home of: </strong> Hije</p><p data-v-33854e1f> A dreary realm of darkness and shadow, the shadowfell drains emotion and memory from those who go there. </p><h4 data-v-33854e1f>Aposynthesi</h4><p data-v-33854e1f><strong data-v-33854e1f>Home of: </strong> Interitus</p><p data-v-33854e1f> The realm of decay, Aposynthesi is a place of creaturest that feed off of death. Full of endless swamps of decaying putrid matter and fungus. </p><h4 data-v-33854e1f>Discotechnus</h4><p data-v-33854e1f><strong data-v-33854e1f>Home of: </strong> Funkus</p><p data-v-33854e1f> The realm of eternal funk. It is the opposite of the shadowfell, full of light, celebration, intense emotion, and happy memories. </p><h4 data-v-33854e1f>The Feywild</h4><p data-v-33854e1f><strong data-v-33854e1f>Home of: </strong> Agrios</p><p data-v-33854e1f> The feywild is the land of wild things. Once a part of Caelum the land of Caelum, the Plane of Air, The feywild became separate when Agrios became enamored with the Material Plane and sought to make his realm more like what he considered the best parts of Gaian&#39;s. </p><h4 data-v-33854e1f>Caelum</h4><p data-v-33854e1f><strong data-v-33854e1f>Home of: </strong> Sylvan</p><p data-v-33854e1f> The plane of air, this is a land of eternal sky, where cities are built on super dense clouds rather than on solid ground. It is closely connected with the Feywild. </p><h4 data-v-33854e1f>Lapisio</h4><p data-v-33854e1f><strong data-v-33854e1f>Home of: </strong> Dorun, Chthonis</p><p data-v-33854e1f> The plane of earth, this is a land of great mountains, caverns, and deserts. </p><h4 data-v-33854e1f>Aquilos</h4><p data-v-33854e1f><strong data-v-33854e1f>Home of: </strong> Trimala, Sedna</p><p data-v-33854e1f> The plane of water, this is a land of endless ocean, where great ice floes cover where land would be. </p><h4 data-v-33854e1f>Ignisia</h4><p data-v-33854e1f><strong data-v-33854e1f>Home of: </strong> Molton, Vulcan</p><p data-v-33854e1f> The plane of fire, the ground itself burns with the heat of this plane. Great volcanoes constantly spew magma creating rivers and oceans of fire and lava. </p><h4 data-v-33854e1f>Arcanius</h4><p data-v-33854e1f><strong data-v-33854e1f>Home of: </strong> Magus</p><p data-v-33854e1f> The realm of pure magic. </p><h4 data-v-33854e1f>Monstrathelas, Land of Monsters</h4><p data-v-33854e1f><strong data-v-33854e1f>Home of: </strong> Leviathan</p><p data-v-33854e1f> A land where everything is somehow bigger. </p><h4 data-v-33854e1f>Lucusectus</h4><p data-v-33854e1f><strong data-v-33854e1f>Home of: </strong> Alidal</p><p data-v-33854e1f> The Hunting Grounds, Lucusectus is a land of endless wilds, filled with animals both prey and predator. </p><h4 data-v-33854e1f>Frugios</h4><p data-v-33854e1f><strong data-v-33854e1f>Home of: </strong> Sara</p><p data-v-33854e1f> A land of plenty, where plants grow faster and bear more fruit. </p><hr data-v-33854e1f><h3 data-v-33854e1f>The Planes of Concept</h3><h4 data-v-33854e1f>Logos</h4><p data-v-33854e1f><strong data-v-33854e1f>Home of: </strong> Nera</p><p data-v-33854e1f>Logos the great plane of ideas. It is said nothing exists that does not have its perfected form in Logos. Logos is separated into 4 sections, at the center of which is the Confluence, An island on which Nera&#39;s palace sits. The four quadrants around it are the Negative Energy Sea, which flows from Necronus; the Positive Energy Sea, which flows from Celestia; The Plains of Stillness, containing the road to Mechanus, and The Seas of Chance, a chaotic realm that flows out from Mercuria.</p><h4 data-v-33854e1f>Celestia</h4><p data-v-33854e1f><strong data-v-33854e1f>Home of: </strong> Alohim, Amathera</p><p data-v-33854e1f> A realm of peace and rest, Celestia serves as the source of radiant light. No shadows exist in Celestia, and it is eternally daytime. It is dominated by the massive Mount Celestia, whose slopes cannot be measured but instead measure the worth of a man. </p><p data-v-33854e1f> The base of the mountain is dominated by the City of the Righteous, a place of kindness and giving that is the home of Amathera. There she travels from home to home, and ensures that all are able to enjoy the peace of Celestia. </p><p data-v-33854e1f> Those who achieved greatness in their lives are encouraged to attempt the climb up the mountain, at the top of which is the Shining Palace of Alohim. The climb involves a series of trials that measure the enlightenment of the individual. Should the person undertaking the journey fail, they may climb forever without reaching the top, but for the truly enlightened, the journey passes nearly instantaneously, as they ascend the final steps to bask in Alohim&#39;s light and share in his rulership of the cosmos. </p><h4 data-v-33854e1f>Skoteivas</h4><p data-v-33854e1f><strong data-v-33854e1f>Home of: </strong> Mat&#39;raktha</p><p data-v-33854e1f></p><h4 data-v-33854e1f>The 9 Hells</h4><p data-v-33854e1f><strong data-v-33854e1f>Home of: </strong> Asmodeus</p><p data-v-33854e1f></p><p data-v-33854e1f></p><h4 data-v-33854e1f>Dracinium</h4><p data-v-33854e1f><strong data-v-33854e1f>Home of: </strong> Indra, Bahamut</p><p data-v-33854e1f></p><h4 data-v-33854e1f>Mechanus</h4><p data-v-33854e1f><strong data-v-33854e1f>Home of: </strong> Tock</p><p data-v-33854e1f></p><h4 data-v-33854e1f>Eternium</h4><p data-v-33854e1f><strong data-v-33854e1f>Home of: </strong> Chronos</p><p data-v-33854e1f></p><h4 data-v-33854e1f>Gallaria Perfectum</h4><p data-v-33854e1f><strong data-v-33854e1f>Home of: </strong> Adonna</p><p data-v-33854e1f></p><h4 data-v-33854e1f>Astral Sea</h4><p data-v-33854e1f><strong data-v-33854e1f>Home of: </strong> Maris</p><p data-v-33854e1f></p><h4 data-v-33854e1f>Poetica Melodium</h4><p data-v-33854e1f><strong data-v-33854e1f>Home of: </strong> Bragi</p><p data-v-33854e1f></p><h4 data-v-33854e1f>Mercuria</h4><p data-v-33854e1f><strong data-v-33854e1f>Home of: </strong> Labious</p><p data-v-33854e1f></p><h4 data-v-33854e1f>Chakaria</h4><p data-v-33854e1f><strong data-v-33854e1f>Home of: </strong> Moira</p><p data-v-33854e1f></p><h4 data-v-33854e1f>Mirrodeum</h4><p data-v-33854e1f><strong data-v-33854e1f>Home of: </strong> Alithia</p><p data-v-33854e1f></p><h4 data-v-33854e1f>The Abyss</h4><p data-v-33854e1f><strong data-v-33854e1f>Home of: </strong> Ba&#39;al</p><p data-v-33854e1f></p><h4 data-v-33854e1f>Necronus</h4><p data-v-33854e1f><strong data-v-33854e1f>Home of: </strong> Ptoma</p><p data-v-33854e1f></p><hr data-v-33854e1f><h3 data-v-33854e1f>The Planes of Effect</h3><h4 data-v-33854e1f>Aitia</h4><p data-v-33854e1f><strong data-v-33854e1f>Home of: </strong> Area</p><p data-v-33854e1f></p><h4 data-v-33854e1f>Nephelheim</h4><p data-v-33854e1f><strong data-v-33854e1f>Home of: </strong> Annam, Trolka</p><p data-v-33854e1f> The home of the Giant Gods, Nephelheim is surprisingly varied in its appearance across its face. Most of it is a cold, frozen tundra where the sun does not shine, but with pockets of cold marshlands and dotted with fiery volcanoes. Cities filled with the souls of giants, trolls, and giant kin dot the landscape as well. In this place the Ordning is the absolute law, and everyone and everything knows its place in the heirarchy of strength. </p><h4 data-v-33854e1f>Temerus</h4><p data-v-33854e1f><strong data-v-33854e1f>Home of: </strong> Fanome, Arengesus</p><p data-v-33854e1f></p><h4 data-v-33854e1f>The Nothingness Beyond</h4><p data-v-33854e1f><strong data-v-33854e1f>Home of: </strong> Zhuul</p><p data-v-33854e1f>Where the Far Realm is a land full of madness beyond comprehension, aberrations, and beings beyond the comprehension of mortals, the nothingness beyond is a great empty space. A void where nothing at all can survive. Zhuul embodies this concept of nothingness, and as such has no real home on this plane, but rather encompasses all of it, and none of it. For he is nothingness, and The Nothingness Beyond contains nothing.</p><h4 data-v-33854e1f>The Far Realm</h4><p data-v-33854e1f><strong data-v-33854e1f>Home of: </strong> Fa&#39;atasi</p>',112),i=e("<p data-v-33854e1f></p><h4 data-v-33854e1f>Sanguinus</h4><p data-v-33854e1f><strong data-v-33854e1f>Home of: </strong> Vrasja, Odio</p><p data-v-33854e1f> The realm of blood, ruled by Vrasja and her daughter Odio. This realm is dominated by creatures bent on murder and hatred, both of mortals, and each other. Unlike many of the dark gods, Vrasja and Odio have never sought to expand their influence, but instead take great delight in twisting the minds of mortals against each other, and thus drawing more murderous, hateful souls into their grasp. Their shared palace is dominated by a great arena, where their latest aquisitions battle in brutal blood sport. However, death on this plane is not release, rather those who die here are reborn, their minds slowly becoming more and more dominated by hatred and a lust for blood, until each continually craves their next chance in the arena so that they can wreak havoc once again. </p><h4 data-v-33854e1f>Morbustos</h4><p data-v-33854e1f><strong data-v-33854e1f>Home of: </strong> Ganarea</p><p data-v-33854e1f></p><h4 data-v-33854e1f>Palusectum</h4><p data-v-33854e1f><strong data-v-33854e1f>Home of: </strong> Serangga</p><p data-v-33854e1f></p><h4 data-v-33854e1f>Hiemsal</h4><p data-v-33854e1f><strong data-v-33854e1f>Home of: </strong> Frosti</p><p data-v-33854e1f></p><h4 data-v-33854e1f>Domigarus</h4><p data-v-33854e1f><strong data-v-33854e1f>Home of: </strong> Kamin</p><p data-v-33854e1f></p><h4 data-v-33854e1f>Niktos</h4><p data-v-33854e1f><strong data-v-33854e1f>Home of: </strong> Dorman</p><p data-v-33854e1f></p><h4 data-v-33854e1f>Kolasdrag</h4><p data-v-33854e1f><strong data-v-33854e1f>Home of: </strong> Tiamat</p><p data-v-33854e1f></p><h4 data-v-33854e1f>Chaus Prima</h4><p data-v-33854e1f><strong data-v-33854e1f>Home of: </strong> Malik</p><p data-v-33854e1f></p><h4 data-v-33854e1f>Praetorium Eterni</h4><p data-v-33854e1f><strong data-v-33854e1f>Home of: </strong> Cora</p><p data-v-33854e1f></p>",28);function d(f,p,l,v,m,g){return o(),s("div",null,[h,n(" A realm of twisted minds, madness, and beings beyond the comprehension of mortals. Ocassionally a being from here will become interested in the mortal realm and reach out to touch mortal minds. These beings take many forms and titles, and their interests do not align with anything in particular besides their own curiosity, but those touched by them invariably suffer insanities that put them beyond the mortal. "),i])}const u=t(r,[["render",d],["__scopeId","data-v-33854e1f"]]);export{u as default};
